import React, { useState, useRef, useEffect } from 'react';
import ChatInterface from './ChatInterface';
import '../styles/MainContent.scss';

const MainContent = ({ selectedProject }) => {
  const [isEditingTitle, setIsEditingTitle] = useState(false);
  const [editedTitle, setEditedTitle] = useState('');
  const [isNotificationsOpen, setIsNotificationsOpen] = useState(false);
  const notificationsRef = useRef(null);

  const handleEditClick = () => {
    setIsEditingTitle(true);
    setEditedTitle(selectedProject.name);
  };

  const handleTitleSave = () => {
    // Here you would typically update the project in your state management
    // For now, we'll just exit edit mode
    setIsEditingTitle(false);
    // You might want to call a callback to update the project in parent component
    console.log('Project title updated to:', editedTitle);
  };

  const handleTitleCancel = () => {
    setIsEditingTitle(false);
    setEditedTitle('');
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      handleTitleSave();
    } else if (e.key === 'Escape') {
      handleTitleCancel();
    }
  };

  const handleNotificationsToggle = () => {
    setIsNotificationsOpen(!isNotificationsOpen);
  };

  const handleNotificationsClose = () => {
    setIsNotificationsOpen(false);
  };

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (notificationsRef.current && !notificationsRef.current.contains(event.target)) {
        setIsNotificationsOpen(false);
      }
    };

    if (isNotificationsOpen) {
      document.addEventListener('mousedown', handleClickOutside);
      return () => {
        document.removeEventListener('mousedown', handleClickOutside);
      };
    }
  }, [isNotificationsOpen]);

  return (
    <div className="main-content">
      {/* Top Navigation */}
      <div className="main-content__nav body-nav-container">
        {/* Project Breadcrumb Navigation */}
        <div className="main-content__project-info-container">
        {selectedProject && (
          <div className="main-content__project-nav">
            <div className="main-content__project-header">
              {isEditingTitle ? (
                <input
                  type="text"
                  value={editedTitle}
                  onChange={(e) => setEditedTitle(e.target.value)}
                  onBlur={handleTitleSave}
                  onKeyDown={handleKeyPress}
                  className="main-content__project-title-input"
                  autoFocus
                />
              ) : (
                <h2 className="main-content__project-title">{selectedProject.name}</h2>
              )}
              <svg 
                className="main-content__project-share" 
                xmlns="http://www.w3.org/2000/svg" 
                xmlnsXlink="http://www.w3.org/1999/xlink" 
                width="14" 
                height="14" 
                viewBox="0 0 14 14"
                onClick={handleEditClick}
                style={{ cursor: 'pointer' }}
              >
                <defs>
                  <clipPath id="clipPath2367811232">
                    <path d="M0 0L14 0L14 14L0 14L0 0Z" fillRule="nonzero" transform="matrix(1 0 0 1 0 0)"/>
                  </clipPath>
                </defs>
                <g clipPath="url(#clipPath2367811232)">
                  <path d="M8.70554 2.32503L11.5535 5.17292L4.3446 12.3818L1.4983 9.5339L8.70554 2.32503ZM13.7145 1.63819L12.4444 0.368126C11.9536 -0.122709 11.1566 -0.122709 10.6641 0.368126L9.44747 1.58472L12.2954 4.43263L13.7145 3.01355C14.0952 2.63283 14.0952 2.01888 13.7145 1.63819ZM0.00792508 13.5368C-0.0439033 13.7701 0.166693 13.9791 0.399973 13.9224L3.5735 13.1529L0.727197 10.305L0.00792508 13.5368Z" fillRule="nonzero" transform="matrix(1 0 0 1 0 0.0341408)" fill="rgb(193, 193, 193)"/>
                </g>
              </svg>
            </div>
            <div className="main-content__breadcrumb">
              <span className="main-content__breadcrumb-item">{selectedProject.workspace}</span>
              <svg className="main-content__breadcrumb-arrow" width="16" height="16" viewBox="0 0 16 16" fill="none">
                <path d="M6 12L10 8L6 4" stroke="#4B5563" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
              </svg>
              <span className="main-content__breadcrumb-item">Projects</span>
              <svg className="main-content__breadcrumb-arrow" width="16" height="16" viewBox="0 0 16 16" fill="none">
                <path d="M6 12L10 8L6 4" stroke="#4B5563" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
              </svg>
              <span className="main-content__breadcrumb-item">{selectedProject.name}</span>
            </div>
          </div>
        )}
        </div>

        {/* Settings Icon with Notifications Menu */}
        <div className="main-content__settings-container" ref={notificationsRef}>
          <svg 
            xmlns="http://www.w3.org/2000/svg" 
            width="20" 
            height="20" 
            viewBox="0 0 20 20" 
            className="settings-icon"
            onClick={handleNotificationsToggle}
            style={{ cursor: 'pointer' }}
          >
            <defs>
              <clipPath id="clipPath5917372953-settings">
                <path d="M0 0L20 0L20 20L0 20L0 0Z" fillRule="nonzero" transform="matrix(1 0 0 1 0 0)"/>
              </clipPath>
            </defs>
            <g clipPath="url(#clipPath5917372953-settings)">
              <path d="M3.59965 9.82892C3.23589 9.82892 2.94106 9.53386 2.94106 9.17032L2.94106 7.71878C2.94106 7.53767 3.0157 7.36446 3.14742 7.23976L5.2446 5.25981C5.65578 4.8326 5.8819 4.27148 5.8819 3.67787L5.8819 3.5995C5.8819 2.97888 5.63712 2.39844 5.19235 1.96509C4.7478 1.53173 4.16209 1.29969 3.53884 1.31813C2.31386 1.34974 1.31719 2.40283 1.31719 3.6658C1.31719 4.02956 1.02236 4.32439 0.658594 4.32439C0.29483 4.32439 0 4.02956 0 3.6658C0 1.69484 1.57228 0.051213 3.50482 0.00137955C4.48546 -0.0254032 5.41035 0.338579 6.11153 1.02176C6.81271 1.70516 7.19887 2.62061 7.19887 3.5995L7.19887 3.67787C7.19887 4.62076 6.83686 5.51227 6.17893 6.18799C6.17256 6.19457 6.16576 6.20116 6.15917 6.20753L4.25825 8.00263L4.25825 9.17032C4.25825 9.53409 3.96342 9.82892 3.59965 9.82892Z" fillRule="nonzero" transform="matrix(1 0 0 1 6.38889 3.86949)" fill="rgb(196, 196, 196)"/>
              <path d="M0.878125 1.75488C0.821047 1.75488 0.763969 1.75027 0.706891 1.73951C0.649813 1.72634 0.59493 1.71097 0.542243 1.68902C0.489555 1.66706 0.439063 1.63874 0.390766 1.60801C0.342469 1.57508 0.298563 1.53974 0.256852 1.49824C0.0943984 1.33557 0 1.10945 0 0.876752C0 0.819454 0.00658528 0.762376 0.0175625 0.705519C0.0285389 0.650636 0.046102 0.593556 0.0680548 0.540869C0.0900076 0.488182 0.116352 0.437689 0.147086 0.389392C0.180016 0.341095 0.217336 0.29719 0.256852 0.255698C0.298563 0.215963 0.342469 0.178643 0.390766 0.148128C0.439063 0.115198 0.489556 0.0888559 0.542243 0.0669014C0.59493 0.0449486 0.649813 0.0273846 0.706891 0.0166285C0.818851 -0.00554369 0.937398 -0.00554369 1.04936 0.0166285C1.10644 0.0276057 1.16132 0.045168 1.21401 0.0669014C1.26648 0.0890736 1.31719 0.115198 1.36527 0.148128C1.41356 0.178862 1.45747 0.216182 1.49918 0.255698C1.53869 0.29719 1.57601 0.341315 1.60894 0.389392C1.63968 0.437909 1.66602 0.48818 1.68776 0.540869C1.70993 0.593556 1.72749 0.650636 1.73825 0.705519C1.74923 0.762597 1.75581 0.819673 1.75581 0.876752C1.75581 1.10945 1.66119 1.33557 1.49896 1.49803C1.33475 1.66267 1.10863 1.75488 0.878125 1.75488Z" fillRule="nonzero" transform="matrix(1 0 0 1 9.11241 14.5718)" fill="rgb(196, 196, 196)"/>
              <path d="M9.87891 19.7578C4.43168 19.7578 0 15.3261 0 9.87891C0 4.43168 4.43168 0 9.87891 0C15.3261 0 19.7578 4.43168 19.7578 9.87891C19.7578 15.3261 15.3261 19.7578 9.87891 19.7578ZM9.87891 1.31719C5.15789 1.31719 1.31719 5.15789 1.31719 9.87891C1.31719 14.5999 5.15789 18.4406 9.87891 18.4406C14.5999 18.4406 18.4406 14.5999 18.4406 9.87891C18.4406 5.15789 14.5999 1.31719 9.87891 1.31719Z" fillRule="nonzero" transform="matrix(1 0 0 1 0.110677 0.109863)" fill="rgb(196, 196, 196)"/>
            </g>
          </svg>

          {/* Notifications Menu */}
          {isNotificationsOpen && (
            <div className="notifications-menu">
              <div className="notifications-menu__header">
                <div className="notifications-menu__title">Notifications</div>
                <div className="notifications-menu__badge">3</div>
                <div className="notifications-menu__mark-read">Mark All as Read</div>
              </div>

              <div className="notifications-menu__content">
                <div className="notification-item notification-item--unread">
                  <div className="notification-item__icon notification-item__icon--blue">
                    <svg width="20" height="20" viewBox="0 0 20 20" fill="none">
                      <path d="M8 12L18 7L8 2V6L14 7L8 8V12Z" fill="currentColor"/>
                    </svg>
                  </div>
                  <div className="notification-item__content">
                    <div className="notification-item__title">New message in Project A discussion</div>
                    <div className="notification-item__meta">
                      <svg width="12" height="12" viewBox="0 0 12 12" fill="none">
                        <path d="M6 1v5l4 4" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                      </svg>
                      <span>July 8, 2025  10:30 AM</span>
                      <svg width="7" height="16" viewBox="0 0 7 16" fill="none">
                        <path d="M1 4L6 8L1 12" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                      </svg>
                      <span>Chat</span>
                    </div>
                  </div>
                  <div className="notification-item__close">
                    <svg width="16" height="16" viewBox="0 0 16 16" fill="none">
                      <path d="M12 4L4 12M4 4L12 12" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                    </svg>
                  </div>
                </div>

                <div className="notification-item notification-item--unread notification-item--active">
                  <div className="notification-item__icon notification-item__icon--indigo">
                    <svg width="20" height="20" viewBox="0 0 20 20" fill="none">
                      <path d="M4 6h12M4 10h12M4 14h12" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                    </svg>
                  </div>
                  <div className="notification-item__content">
                    <div className="notification-item__title">Strategy document has been updated with new content</div>
                    <div className="notification-item__meta">
                      <svg width="12" height="12" viewBox="0 0 12 12" fill="none">
                        <path d="M6 1v5l4 4" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                      </svg>
                      <span>July 7, 2025  3:45 PM</span>
                      <svg width="7" height="16" viewBox="0 0 7 16" fill="none">
                        <path d="M1 4L6 8L1 12" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                      </svg>
                      <span>Document</span>
                    </div>
                  </div>
                  <div className="notification-item__close">
                    <svg width="16" height="16" viewBox="0 0 16 16" fill="none">
                      <path d="M12 4L4 12M4 4L12 12" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                    </svg>
                  </div>
                </div>

                <div className="notification-item notification-item--unread">
                  <div className="notification-item__icon notification-item__icon--yellow">
                    <svg width="20" height="20" viewBox="0 0 20 20" fill="none">
                      <path d="M10 2L3 7v11h4v-6h6v6h4V7l-7-5z" fill="currentColor"/>
                    </svg>
                  </div>
                  <div className="notification-item__content">
                    <div className="notification-item__title">Your subscription will renew in 7 days</div>
                    <div className="notification-item__meta">
                      <svg width="12" height="12" viewBox="0 0 12 12" fill="none">
                        <path d="M6 1v5l4 4" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                      </svg>
                      <span>July 6, 2025  9:15 AM</span>
                      <svg width="7" height="16" viewBox="0 0 7 16" fill="none">
                        <path d="M1 4L6 8L1 12" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                      </svg>
                      <span>Billing</span>
                    </div>
                  </div>
                  <div className="notification-item__close">
                    <svg width="16" height="16" viewBox="0 0 16 16" fill="none">
                      <path d="M12 4L4 12M4 4L12 12" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                    </svg>
                  </div>
                </div>

                <div className="notification-item">
                  <div className="notification-item__icon notification-item__icon--indigo">
                    <svg width="20" height="20" viewBox="0 0 20 20" fill="none">
                      <path d="M4 6h12M4 10h12M4 14h12" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                    </svg>
